import React, {
		createContext,
		useReducer
} from 'react';
import mainReducer from './mainReducer.js';

const MainContextProvider = (props) => {

const [main, dispatch] = useReducer(mainReducer, {
				music: false,
				dark: false
});

return(

		<mainContextProvider value={{main, dispatch}}>
				{props.children}
		</mainContextProvider>

)};

export default MainContextProvider;
